import './App.css';
import Main from './components/Main/Main'
import Login from './components/Login/Login'
import {
  BrowserRouter as Router,
  Switch,
  useLocation
} from "react-router-dom";

function App() {
  return (
    <Router>
      <Switch>
        {/* <Login /> */}
        {/* <Main /> */}
        <Route exact path="/login" component={Login} />
        <Route exact path="/overview" component = {Main} />
      </Switch>

    </Router>

  );
}

export default App;
